import React, { type HTMLInputTypeAttribute } from 'react';

type InputProps = {
  id: string;
  name?: string;
  label: string;
  type?: HTMLInputTypeAttribute;
  minlength?: number;
  onChange: (val: any) => void;
};

export const Input = ({
  id,
  name,
  label,
  type = 'text',
  minlength,
  onChange,
}: InputProps) => {
  return (
    <div>
      <label htmlFor={id}>{label}</label>
      <input
        id={id}
        name={name ?? id}
        type={type}
        minlength={minlength}
        onChange={onChange}
      />
    </div>
  );
};

export default Input;
